import React, { Component } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

class Like extends Component {
  render() {
    let lik;
    !this.props.like ? (lik = "fas") : (lik = "far");
    console.log(lik);
    return (
      <td>
        <FontAwesomeIcon icon={[lik, "heart"]} style={{ cursor: "pointer" }} />
      </td>
    );
  }
}

export default Like;
